import { Grid } from "@mui/material";
import React from "react";

const Dashboard = () => {
    const textStyle = {color: '#f5f5f5'}

    return (
        <Grid container columnGap={3} rowGap={2} marginTop={'1em'} justifyContent={'center'}>
            <Grid
                container
                item
                border={1}
                borderRadius={4}
                xs={3}
                height={'10em'}
                bgcolor={'#262626'}
                display={'flex'}
                alignItems={'center'}
                justifyContent={'center'}
                sx={{ boxShadow: 4 }}
            >
                <GridList cols={2}>
                    
                </GridList>
                <Grid item xs={7}>
                    <h1 style={textStyle}>Number of tasks:</h1>
                </Grid>
                <Grid item xs={5}>
                    <h1 style={textStyle}>0</h1>
                </Grid>
            </Grid>
            <Grid item border={1} borderRadius={4} xs={8} height={'10em'} bgcolor={'#262626'} sx={{ boxShadow: 4 }}>
                Hello
            </Grid>
            <Grid item border={1} borderRadius={4} xs={8} height={'10em'} bgcolor={'#262626'} sx={{ boxShadow: 4 }}>
                Hello
            </Grid>
            <Grid item border={1} borderRadius={4} xs={3} height={'10em'} bgcolor={'#262626'} sx={{ boxShadow: 4 }}>
                Hello
            </Grid>
        </Grid>
    )
}

export default Dashboard;
